import "./Expenses.css";

function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        title={[0].title}
        amount={[0].amount}
        date={[0].date}
      />
      <ExpenseItem
        title={[1].title}
        amount={[1].amount}
        date={[1].date}
      />
      <ExpenseItem
        title={[2].title}
        amount={[2].amount}
        date={[2].date}
      />
      <ExpenseItem
        title={[3].title}
        amount={[3].amount}
        date={[3].date}
      />
    </div>
  );
}

export default Expenses;
